import React from 'react';
import music from './music.png';
import gold from './gold.png';
class Process extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [
        { name: "绿钻豪华版：未开通", val: 50, text: ['LV0', 'LV1'] },
        { name: "付费音乐包：未开通", val: 90, text: ['LV01', 'LV2'] }
      ]
    }
  }
  render() {
    return (
      <div>
        {
          this.state.data.map((s, i) => {
            let bg = null;
            if (i == 0) {
              bg=gold
            } else if (i == 1) {
              bg=music
            }
            return <div key={s + i}>

              <div style={{
                display:'flex'
              }}>
                <span style={{
                  width: 16,
                  height: 16,
                  background: `url(${bg}) no-repeat`,
                  display:'block'
                }}></span>
                <div></div>
              </div>
              <div style={{fontSize:12,color:'#666'}}>绿钻豪华版：未开通</div>
            </div>
          })
        }

      </div>
    )
  }
}
export default Process;
